import React, { Component } from 'react';
import * as d3 from 'd3';
//import { Link } from 'react-router-dom';
import { Dropdown, Input, Grid, Segment, Tab } from 'semantic-ui-react';
import './TabView.css';

const panes = [
    { menuItem: 'Force Display', render: () => <Tab.Pane>Force Display</Tab.Pane> },
    { menuItem: 'Bar Display', render: () => <Tab.Pane>Bar Display</Tab.Pane> },
]

class TabView extends Component {


    render () {

        return (
            <div>
                <Tab panes={panes} />
            </div>
        );
    }

}
export default TabView;
